INSERT INTO `pages` (`id`, `type`, `title`, `slug`, `content`, `meta_title`, `meta_description`, `keywords`, `meta_image`, `created_at`, `updated_at`) VALUES
(1, 'home_page', 'Home Page', 'home', NULL, NULL, NULL, NULL, NULL, '2020-11-04 10:13:20', '2020-11-04 10:13:20'),
(2, 'seller_policy_page', 'Seller Policy', 'sellerpolicy', '<p><br></p>', 'Seller Policy', 'Motorsheba Seller Policy', NULL, NULL, '2020-11-04 10:14:41', '2021-10-31 08:55:04'),
(3, 'return_policy_page', 'Return Policy', 'returnpolicy', '<h5><b>Refunds & Returns Policy</b></h5>\r\n    <h5><b>Issuance of Refunds</b></h5>\r\n    <p><span style=\"font-weight: 400;\">If your product is eligible for a refund, you can choose your preferred refund method based on the table below. The shipping fee is refunded along with the amount paid for your returned product.</span></p>\r\n    <p><span style=\"font-weight: 400;\">The time required to complete a refund depends on the refund method you have selected. Once we have received your product (2-3 working days) and it has undergone quality control (1-2 working days), the expected refund processing times are as follows:</span></p>\r\n    <p><span style=\"font-weight: 400;\">Please note that this policy does not apply to Motorsheba.</span></p>\r\n    <table>\r\n       <tbody>\r\n          <tr>\r\n             <td>\r\n                <p><b>Payment Method</b></p>\r\n             </td>\r\n             <td>\r\n                <p><b>Refund Option</b></p>\r\n             </td>\r\n             <td>\r\n                <p><b>Refund Time</b></p>\r\n             </td>\r\n          </tr>\r\n          <tr>\r\n             <td>\r\n                <p><span style=\"font-weight: 400;\">All</span></p>\r\n             </td>\r\n             <td>\r\n                <p><span style=\"font-weight: 400;\">Refund Voucher</span></p>\r\n             </td>\r\n             <td>\r\n                <p><span style=\"font-weight: 400;\">1-2 working days</span></p>\r\n             </td>\r\n          </tr>\r\n          <tr>\r\n             <td>\r\n                <p><span style=\"font-weight: 400;\">Debit or Credit Card</span></p>\r\n             </td>\r\n             <td>\r\n                <p><span style=\"font-weight: 400;\">Debit or Credit Card Payment Reversal</span></p>\r\n             </td>\r\n             <td>\r\n                <p><span style=\"font-weight: 400;\">9-10 working days</span></p>\r\n             </td>\r\n          </tr>\r\n          <tr>\r\n             <td>\r\n                <p><span style=\"font-weight: 400;\">bKash/Rocket (DBBL)</span></p>\r\n             </td>\r\n             <td>\r\n                <p><span style=\"font-weight: 400;\">Bank Deposit / Mobile Payment Reversal</span></p>\r\n             </td>\r\n             <td>\r\n                <p><span style=\"font-weight: 400;\">7 working days</span></p>\r\n             </td>\r\n          </tr>\r\n       </tbody>\r\n    </table>\r\n    <p><span style=\"font-weight: 400;\"><strong>Important Note:</strong> The Voucher discount code can only be applied once. The leftover amount will not be refunded or used for the next purchase even if the value of the order is smaller than</span></p>\r\n    <h5><b>Returns Policy</b></h5>\r\n    <p><span style=\"font-weight: 400;\">If your product is defective/damaged or incorrect/incomplete at the time of delivery, please contact us within the applicable return window. Your product may be eligible for a refund or replacement depending on the product category and condition. Please see the detailed terms in the relevant category below.</span></p>\r\n    <h5><b>Valid reasons to return an item</b></h5>\r\n    <ol>\r\n       <li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Delivered Product is damaged (physically destroyed or broken) / defective (dead on arrival)</span></li>\r\n       <li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Delivered Product is incorrect (presentation different on the website) / incomplete (missing parts).</span></li>\r\n       <li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Delivered Product is “No longer needed” (you no longer have a use for the product / you have changed your mind about the purchase / the size of a fashion product does not fit / you do not like the product after opening the package) – eligible for selected products only.</span></li>\r\n    </ol>\r\n    <h5><b>Conditions for Returns</b></h5>\r\n    <ol>\r\n       <li><span style=\"font-weight: 400;\"> The product must be unused, unworn, unwashed, and without any flaws. Fashion products can be tried on to see if they fit and will still be considered unworn</span></li>\r\n       <li><span style=\"font-weight: 400;\"> The product must include the original tags, user manual, warranty cards, freebies, and accessories</span></li>\r\n       <li><span style=\"font-weight: 400;\"> The product must be returned in the original and undamaged manufacturer packaging/box. If the product was delivered in the second layer of Motorsheba packaging, it must be returned in the same condition with the return shipping label attached. Do not put tape or stickers on the manufacturer’s box</span></li>\r\n    </ol>\r\n    <p><b>If a product is returned to us in an inadequate condition, we reserve the right to send it back to you.  </b></p>\r\n    <h5><br><br><br></h5>', 'Return Policy', 'Motorsheba Return Policy Page', NULL, NULL, '2020-11-04 10:14:41', '2021-10-31 08:54:24'),
(4, 'support_policy_page', 'Support Policy', 'supportpolicy', '<p>Support policy\r\n</p><p>We offer technical support only to our customers via email. We will help you with issues regarding the installation, setup, modification and customization, or if you\'re having trouble with your account or order.\r\n</p><p>After your purchase we will communicate you the official email for the support service. If you are our customer you can find more information by logging in then click \"Contact Us\" on the Footer.\r\n</p><p>If you are not our customer and you need some generic information regarding Motorsheba or our associate products feel free to contact us, we will be happy to answer your questions.\r\n</p><p>Support Hours\r\n</p><p>We usually answer questions Monday to Friday, 9am-6pm, Italian time ( GMT +6 ). You will most likely get an answer within 48 hours on workdays.\r\n</p><p>Support Duration\r\n</p><p>If you paid for a order, we offer a 40 days support period ( starting from the day of the purchase ).\r\n</p><p>Extent of our support\r\n</p><p>We only cover support for our order and we cannot give support that isn’t related to other irrelavent issues.\r\n</p><p>We may not offer service if you are registered. For a order cancelation the user may pay additional fees.\r\n</p><p>Bug Fixing\r\n</p><p>It is our commitment to recover all possible issues after they are brought to our attention.\r\n</p><p>If you discover any bug please contact us. Thank you!</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p>', 'Support Policy', 'Motorsheba Support Policy', NULL, NULL, '2020-11-04 10:14:59', '2021-10-31 08:53:53'),
(5, 'terms_conditions_page', 'Term Conditions', 'terms', '<p>Terms & Condition\r\n</p><p>Please read the following terms and conditions very carefully as your use of service is subject to your acceptance of and compliance with the following terms and conditions (\"Terms\").\r\n</p><p>By subscribing to or using any of our services you agree that you have read, understood and are bound by the Terms, regardless of how you subscribe to or use the services. If you do not want to be bound by the Terms, you must not subscribe to or use our services.\r\n</p><p>In these Terms, references to \"you\", \"User\" shall mean the end user accessing the Website, its contents and using the Services offered through the Website. \"Service Providers\" mean independent third party service providers, and \"we\", \"us\" and \"our\" shall mean Motorsheba, its franchisor, affiliates and partners.\r\n</p><p>General Introduction\r\n</p><p>1.https://motorsheba.com website (\"Website\") is an Internet based content and e-commerce portal operated by Motorsheba (Pvt.) Limited, a company incorporated under the laws of Bangladesh.\r\n</p><p>2.Use of the Website is offered to you conditioned on acceptance without modification of all the terms, conditions and notices contained in these Terms, as may be posted on the Website from time to time. motorsheba.com at its sole discretion reserves the right not to accept a User from registering on the Website without assigning any reason thereof.\r\n</p><p>User Account, Password, and Security:\r\n</p><p>You will receive a password and account designation upon completing the Website\'s registration process. You are responsible for maintaining the confidentiality of the password and account, and are fully responsible for all activities that occur under your password or account. You agree to (a) immediately notify motorsheba.com of any unauthorized use of your password or account or any other breach of security, and (b) ensure that you exit from your account at the end of each session.\r\n</p><p>Services Offered:\r\n</p><p>motorsheba.com provides a number of Internet-based services through the Web Site (all such services, collectively, the \"Service\"). One such service enables users to purchase original merchandise such as toys, baby items, from various fashion and lifestyle brands, (Collectively \"Products\"). Upon placing an order, motorsheba.com shall ship the product to you and be entitled to its payment for the Services.\r\n</p><p>Privacy Policy:\r\n</p><p>The User hereby consents, expresses and agrees that he has read and fully understands the Privacy Policy of motorsheba.com the Website. The user further consents that the terms and contents of such Privacy Policy are acceptable to him.\r\n</p><p>Limited User:\r\n</p><p>The User agrees and undertakes not to reverse engineer, modify copy, distribute, transmit, display, perform, reproduce, publish, license, create derivative works from, transfer, or sell any information or software obtained from the Website. Limited reproduction and copying of the content of the Website is permitted provided that Motorsheba\'s name is stated as the source and prior written permission of motorsheba.com is sought. For the removal of doubt, it is clarified that unlimited or wholesale reproduction, copying of the content for commercial or non-commercial purposes and unwarranted modification of data and information within the content of the Website is not permitted.\r\n</p><p>User Conduct and Rules:\r\n</p><p>You agree and undertake to use the Website and the Service only to post and upload messages and material that are proper. By way of example, and not as a limitation, you agree and undertake that when using a Service, you will not:\r\n</p><p>1. defame, abuse, harass, stalk, threaten or otherwise violate the legal rights of others;\r\n</p><p>2. publish, post, upload, distribute or disseminate any inappropriate, profane, defamatory, infringing, obscene, indecent or unlawful topic, name, material or information;\r\n</p><p>3. upload files that contain software or other material protected by intellectual property laws unless you own or control the rights thereto or have received all necessary consents;\r\n</p><p>4. upload or distribute files that contain viruses, corrupted files, or any other similar software or programs that may damage the operation of the Website or another\'s computer;\r\n</p><p>5. conduct or forward surveys, contests, pyramid schemes or chain letters;\r\n</p><p>6. download any file posted by another user of a Service that you know, or reasonably should know, cannot be legally distributed in such manner;\r\n</p><p>7. falsify or delete any author attributions, legal or other proper notices or proprietary designations or labels of the origin or source of software or other material contained in a file that is uploaded;\r\n</p><p>8. violate any code of conduct or other guidelines, which may be applicable for or to any particular Service;\r\n</p><p>9. violate any applicable laws or regulations for the time being in force in or outside Bangladesh; and\r\n</p><p>10. violate any of the terms and conditions of this Agreement or any other terms and conditions for the use of the Website contained elsewhere herein.\r\n</p><p>User Warranty and Representation:\r\n</p><p>The user guarantees, warrants, and certifies that you are the owner of the content which you submit or otherwise authorised to use the content and that the content does not infringe upon the property rights, intellectual property rights or other rights of others. You further warrant that to your knowledge, no action, suit, proceeding, or investigation has been instituted or threatened relating to any content, including trademark, trade name service mark, and copyright formerly or currently used by you in connection with the Services rendered by motorsheba.com.\r\n</p><p>Exactness Not Guaranteed:\r\n</p><p>motorsheba.com hereby disclaims any guarantees of exactness as to the finish and appearance of the final Product as ordered by the user. The quality of any products, Services, information, or other material purchased or obtained by you through the Website may not meet your expectations. Alterations to certain aspects of your order such as the merchandise brand, size, colour etc. may be required due to limitations caused by availability of product difference in size charts of respective brands etc. In this instance you agree that a representative from motorsheba.com will call you or send an approval request via the email address which you submitted when placing your order. If you do not agree with the requested change you retain the right to reject the requested production change by replying to it within 10 days of it being sent to you. motorsheba.com may re-request that you accept a production alteration one additional time if an alternative method to send your merchandise is available. If you reject this 2nd request your order will be cancelled and you will be fully refunded via your initial method of payment.\r\n</p><p>Intellectual Property Rights:\r\n</p><p>1. Unless otherwise indicated or anything contained to the contrary or any proprietary material owned by a third party and so expressly mentioned, motorsheba.com owns all Intellectual Property Rights to and into the Website, including, without limitation, any and all rights, title and interest in and to copyright, related rights, patents, utility models, trademarks, trade names, service marks, designs, know-how, trade secrets and inventions (whether patentable or not), goodwill, source code, meta tags, databases, text, content, graphics, icons, and hyperlinks. You acknowledge and agree that you shall not use, reproduce or distribute any content from the Website belonging to motorsheba.com without obtaining authorization from motorsheba.com.\r\n</p><p>2. Notwithstanding the foregoing, it is expressly clarified that you will retain ownership and shall solely be responsible for any content that you provide or upload when using any Service, including any text, data, information, images, photographs, music, sound, video or any other material which you may upload, transmit or store when making use of our various Service. However, with regard to the product customization Service (as against other Services like blogs and forums) you expressly agree that by uploading and posting content on to the Website for public viewing and reproduction/use of your content by third party users, you accept the User whereby you grant a non-exclusive license for the use of the same.\r\n</p><p>Links to Third Party Sites:\r\n</p><p>The Website may contain links to other websites (\"Linked Sites\").The Linked Sites are not under the control of motorsheba.com or the Website and motorsheba.com is not responsible for the contents of any Linked Site, including without limitation any link contained in a Linked Site, or any changes or updates to a Linked Site. motorsheba.com is not responsible for any form of transmission, whatsoever, received by you from any Linked Site. motorsheba.com is providing these links to you only as a convenience, and the inclusion of any link does not imply endorsement by motorsheba.com or the Website of the Linked Sites or any association with its operators or owners including the legal heirs or assigns thereof. The users are requested to verify the accuracy of all information on their own before undertaking any reliance on such information.\r\n</p><p>Disclaimer of Warranties/Limitation of Liability:\r\n</p><p>motorsheba.com has endeavored to ensure that all the information on the Website is correct, but motorsheba.com neither warrants nor makes any representations regarding the quality, accuracy or completeness of any data, information, product or Service. In no event shall motorsheba.com be liable for any direct, indirect, punitive, incidental, special, consequential damages or any other damages resulting from:\r\n</p><p>(a) the use or the inability to use the Services;\r\n</p><p>(b) unauthorized access to or alteration of the user\'s transmissions or data;\r\n</p><p>(c) any other matter relating to the services; including, without limitation, damages for loss of use, data or profits, arising out of or in any way connected with the use or performance of the Website or Service.\r\n</p><p>Neither shall motorsheba.com be responsible for the delay or inability to use the Website or related services, the provision of or failure to provide Services, or for any information, software, products, services and related graphics obtained through the Website, or otherwise arising out of the use of the website, whether based on contract, tort, negligence, strict liability or otherwise. Further, motorsheba.com shall not be held responsible for non-availability of the Website during periodic maintenance operations or any unplanned suspension of access to the website that may occur due to technical reasons or for any reason beyond motorsheba.com\'s control. The user understands and agrees that any material and/or data downloaded or otherwise obtained through the Website is done entirely at their own discretion and risk and they will be solely responsible for any damage to their computer systems or loss of data that results from the download of such material and/or data.\r\n</p><p>Indemnification:\r\n</p><p>You agree to indemnify, defend and hold harmless motorsheba.com from and against any and all losses, liabilities, claims, damages, costs and expenses (including legal fees and disbursements in connection therewith and interest chargeable thereon) asserted against or incurred by motorsheba.com that arise out of, result from, or may be payable by virtue of, any breach or non-performance of any representation, warranty, covenant or agreement made or obligation to be performed by you pursuant to these Terms.\r\n</p><p>Pricing:\r\n</p><p>Prices for products are described on our Website and are incorporated into these Terms by reference. All prices are in Bangladeshi Taka. Prices, products and Services may change at motorsheba.com discretion.\r\n</p><p>Shipping:\r\n</p><p>Title and risk of loss for all products ordered by you shall pass on to you upon motorsheba.com\'s shipment to the shipping carrier.\r\n</p><p>Termination:\r\n</p><p>1. motorsheba.com may suspend or terminate your use of the Website or any Service if it believes, in its sole and absolute discretion that you have breached any of the Terms.\r\n</p><p>2. If you or motorsheba.com terminates your use of the Website or any Service, motorsheba.com may delete any content or other materials relating to your use of the Service and motorsheba.com will have no liability to you or any third party for doing so.\r\n</p><p>3. You shall be liable to pay for any Service or product that you have already ordered till the time of Termination by either party whatsoever. Further, you shall be entitled to your royalty payments as per the User License Agreement that has or is legally deemed accrued to you.\r\n</p><p>Governing Law:\r\n</p><p>These terms shall be governed by and constructed in accordance with the laws of Bangladesh without reference to conflict of laws principles and disputes arising in relation hereto shall be subject to the exclusive jurisdiction of the courts at Dhaka, Bangladesh.\r\n</p><p>Headings:\r\n</p><p>The headings and subheadings herein are included for convenience and identification only and are not intended to describe, interpret, define or limit the scope, extent or intent of the Terms or the right to use the Website by you contained herein or any other section or pages of the Website or any Linked Sites in any manner whatsoever.\r\n</p><p>Interpretation Of Number And Genders:\r\n</p><p>The Terms herein shall apply equally to both the singular and plural form of the terms defined. Whenever the context may require, any pronoun shall include the corresponding masculine and feminine. The words \"include\", \"includes\" and \"including\" shall be deemed to be followed by the phrase \"without limitation\". Unless the context otherwise requires, the terms \"herein\", \"hereof\", \"hereto\", \"hereunder\" and words of similar import refer to the Terms as a whole.\r\n</p><p>Severability:\r\n</p><p>If any provision of the Terms is determined to be invalid or unenforceable in whole or in part, such invalidity or unenforceability shall attach only to such provision or part of such provision and the remaining part of such provision and all other provisions of these Terms shall continue to be in full force and effect.\r\n</p><p>Report Abuse:\r\n</p><p>As per these Terms, users are solely responsible for every material or content uploaded on to the Website. motorsheba.com does not review the contents in any way before they appear on the Website. motorsheba.com does not verify, endorse or otherwise vouch for the contents of any user or any content generally posted or uploaded on to the Website. Users can be held legally liable for their contents and may be held legally accountable if their contents or material include, for example, defamatory comments or material protected by copyright, trademark, etc. If you come across any abuse or violation of these Terms, please report to support@motorsheba.com.\r\n</p><p>What we do about mispricing\'s Despite our best efforts, a small number of the many hundreds of items in our catalogue are mispriced. However, we verify prices as part of our dispatch procedures. If an item\'s correct price is lower than our stated price, we charge the lower amount and send you the item.\r\n</p><p>If a product\'s correct price is higher than our stated price, we will cancel your order and notify you of that cancellation. Terms for Promotions/Contests/Offers/Campaigns\r\n</p><p>General Terms for Offers and Promotions\r\n</p><p>1. Discounts will be applied to the total merchandise value including VAT and applicable taxes. Issuance or redemption of a voucher or coupon will apply to the total value of the qualifying order once all promotional discounts have been applied.\r\n</p><p>2. Only one credit note/gift coupon/coupon can be used per order unless otherwise stated.\r\n</p><p>3. Discount coupons - Discount coupons may from time to time be offered to account holders; such coupons may only be applied to purchases made through the account to which the discount coupon was offered and registered. If you need a refund, this will be made in the same way as the original payment method (such as onto a gift voucher, debit/credit card account, a combination of the two and in case of COD, a cheque).\r\n</p><p>4. Promotional discount coupons - We may from time to time offer promotional discount coupons which may apply in respect of any, or certain specified, purchases made through this Website.\r\n</p><p>5. motorsheba.com shall introduce various offers, schemes or contests at different times. The terms and conditions for such a Contest shall be separately available on the Site.\r\n</p><p>6. motorsheba.com reserves the right to change/modify/add/delete any of the terms and conditions prevailing on the different promotional schemes it introduces in the market from time to time. motorsheba.com, at its discretion, can withdraw a particular scheme from the website or market.\r\n</p><p>7. In case of any query pertaining to use of coupon and/or credit note or regarding the schemes, please email customer care at support@motorsheba.com or call @ +880-9610500500.\r\n</p><p>8. While participating in any motorsheba.com contest you hereby agree to release and hold motorsheba.com (and its officers, directors, agents, subsidiaries, affiliates, joint ventures, and employees) harmless from any claim or demand, but not limited to reasonable attorneys\' fees, or arising out of or related to your participation in the said Contest.\r\n</p><p>Disclaimer:\r\n</p><p>It is the customer\'s responsibility to login earlier if they want to avail better products or styles because motorsheba.com sales are \"first come, first served\". The merchandise is not restocked once sold out. No information regarding the presence of any Product in our stock will be guaranteed and we will alert you only when an item is sold out.\r\n</p><p>The terms and conditions for such a Contest shall be separately available on the Site. In the event of any conflict between these T&C and the terms and conditions pertaining to any Contest, such terms and conditions shall prevail.\r\n</p><p>We as a merchant shall be under no liability whatsoever in respect of any loss or damage arising directly or indirectly out of the decline of authorization for any Transaction, on Account of the Cardholder having exceeded the preset limit mutually agreed by us with our acquiring bank from time to time.</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p>', 'Terms Conditions', 'Motorsheba Terms Conditions', NULL, NULL, '2020-11-04 10:15:29', '2021-10-31 08:53:25'),
(6, 'privacy_policy_page', 'Privacy Policy', 'privacypolicy', '<p>Privacy Policies\r\n</p><p>Data protection is a matter of trust and your privacy is important to us. We shall therefore only use your name and other information which relates to you in the manner set out in this Privacy Policy. We will only collect information where it is necessary for us to do so and we will only collect information if it is relevant to our dealings with you.\r\n</p><p>We will only keep your information for as long as we are either required to by law or as is relevant for the purposes for which it was collected.\r\n</p><p>You can visit the Site and browse without having to provide personal details. During your visit to the Site you remain anonymous and at no time can we identify you unless you have an account on the Site and log on with your user name and password.\r\n</p><p>Data that we collect\r\n</p><p>We may collect various information if you seek to place an order for a product to us on the Site.\r\n</p><p>We collect, store and process your data for processing your purchase on the Site and any possible later claims, and to provide you with our services. We may collect your title, name, gender, email address, postal address, delivery address (if different), telephone number, mobile number, fax number, payment details, payment card details or bank account details.\r\n</p><p>We need this information in order to allow you to go ahead with placing your order for a product. We may use that data to process payment for the product and deliver the product to you. We also use that data to inform you when the product is about to be delivered.\r\n</p><p>We may pass your name and address on to a third party in order to make delivery of the product to you (for example to our courier or supplier).\r\n</p><p>We may also share your data with our franchisor. You further authorize the franchisor to use this information to sell products to you, directly or indirectly.\r\n</p><p>We may also use your data in order to manage the Site, collect payment from you, enable you to subsequently use parts of the Site, detect any fraud or Site abuses, send you information relevant to the Site or our products, and in case we have any queries. Payments that you make through the Site will be processed by our company Motorsheba (Pvt) Limited, a firm registered in Dhaka.\r\n</p><p>You must only submit to us or our agent or the Site information which is accurate and not misleading and you must keep it up to date and inform us of changes.\r\n</p><p>Your actual order details may be stored with us and you may access this information by logging into your account on the Site. Here you can view the details of your orders that have been completed, those which are open and those which are shortly to be dispatched and administer your address details, bank details and any newsletter to which you may have subscribed. You undertake to treat the personal access data confidentially and not make it available to unauthorized third parties. We cannot assume any liability for misuse of passwords unless this misuse is our fault.\r\n</p><p>We shall not share any of your personal information with third parties without your explicit consent. We do not sell or rent your personal information to third parties for their marketing purposes without your explicit consent and we only use your information as described in the Privacy Policy. We view protection of your privacy as a very important community principle. We understand clearly that you and Your Information is one of our most important assets. We store and process Your Information on computers located in Bangladesh that are protected by physical as well as technological security devices. We use third parties to verify and certify our privacy principles. If you object to your Information being transferred or used in this way please do not use the site.\r\n</p><p>Under no circumstances do we rent, trade or share your personal information that we have collected with any other company for their marketing purposes without your consent. We reserve the right to communicate your personal information to any third party that makes a legally-compliant request for its disclosure.\r\n</p><p>Credit Check and Fraud Prevention\r\n</p><p>We use standard and authorized payment services and our Credit Check and Fraud Prevention policies are aligned to these companies. All disputes would be handled by Dhaka Court.\r\n</p><p>Other uses of your personal information\r\n</p><p>We may use your personal information for opinion and market research. Your details are anonymous and will only be used for statistical purposes in motorsheba.com. You can choose to opt out of this at any time. Any answers to surveys or opinion polls motorsheba.com may ask you to complete will not be forwarded on to third parties. Disclosing your email address is only necessary if you would like to take part in competitions. We save the answers to our surveys separately from your email address.\r\n</p><p>We may also send you other information about us, the Site, our other websites, our products, sales promotions, our newsletters, anything relating to other companies in our group or our business partners. If you would prefer not to receive any of this additional information as detailed in this paragraph (or any part of it) please click the link in any email that we send to you. Within 7 working days (days which are neither (i) a Saturday or Sunday, nor (ii) a public holiday anywhere in Bangladesh) of receipt of your instruction we will cease to send you information as requested. If your instruction is unclear we will contact you for clarification.\r\n</p><p>We may further anonymize data about users of the Site generally and use it for various purposes, including ascertaining the general location of the users and usage of certain aspects of the Site or a link contained in an email to those registered to receive them, and supplying that anonymized data to third parties such as publishers. However, that anonymized data will not be capable of identifying you personally.</p><p>Delivery</p><p>We are delivering product within 7 working days.</p><p>\r\n</p><p>Competitions\r\n</p><p>For any competition we use the data to notify winners and advertise our offers. You can find more details where applicable in our participation terms for the respective competition.\r\n</p><p>Third Parties and Links\r\n</p><p>We may pass your details to other companies in our group. We may also pass your details to our agents and subcontractors to help us with any of our uses of your data set out in our Privacy Policy. For example, we may use third parties to assist us with delivering products to you, to help us to collect payments from you, to analyze data and to provide us with marketing or customer service assistance. We may exchange information with third parties for the purposes of fraud protection and credit risk reduction. We may transfer our databases containing your personal information if we sell our business or part of it. Other than as set out in this Privacy Policy, we shall NOT sell or disclose your personal data to third parties without obtaining your prior consent unless this is necessary for the purposes set out in this Privacy Policy or unless we are required to do so by law. The Site may contain advertising of third parties and links to other sites or frames of other sites. Please be aware that we are not responsible for the privacy practices or content of those third parties or other sites, nor for any third party to whom we transfer your data in accordance with our Privacy Policy.\r\n</p><p>Cookies\r\n</p><p>The acceptance of cookies is not a requirement for visiting the Site. However we would like to point out that some functionality on the Site and ordering is only possible with the activation of cookies. Cookies are tiny text files which identify your computer to our server as a unique user when you visit certain pages on the Site and they are stored by your Internet browser on your computer\'s hard drive. Cookies can be used to recognize your Internet Protocol address, saving you time while you are on, or want to enter, the Site. We only use cookies for your convenience in using the Site (for example to remember who you are when you want to amend your shopping cart without having to re-enter your email address) and not for obtaining or using any other information about you (for example targeted advertising). Your browser can be set to not accept cookies, but this would restrict your use of the Site. Please accept our assurance that our use of cookies does not contain any personal or private details and are free from viruses. If you want to find out more information about cookies, go tohttp://www.allaboutcookies.org or to find out about removing them from your browser, go to http://www.allaboutcookies.org/manage-cookies/index.html.\r\n</p><p>The Site uses technology from Google Analytics and Webtrekk GmbH (www.webtrekk.de) through which data is collected and stored for marketing and optimization purposes and data use profiles are prepared under a pseudonym. Cookies may be used for this. The cookies enable recognition of the Internet browser. The data collected with these technologies is not used, without separate authorization by the person concerned, to personally identify the visitors to this website and is not collated with personal data on the pseudonym holder. The permission for data recording and storage may at any time be cancelled with on-going effect.\r\n</p><p>Security\r\n</p><p>We have in place appropriate technical and security measures to prevent unauthorized or unlawful access to or accidental loss of or destruction or damage to your information. When we collect data through the Site, we collect your personal details on a secure server. We will use firewalls on our servers. When we collect payment card details electronically, we use encryption by using Secure Socket Layer (SSL) coding. Whilst we are unable to guarantee 100% security, this makes it hard for a hacker to decrypt your details. You are strongly recommended not to send full credit or debit card details in unencrypted electronic communications with us. We maintain physical, electronic and procedural safeguards in connection with the collection, storage and disclosure of your information. Our security procedures mean that we may occasionally request proof of identity before we disclose personal information to you. You are responsible for protecting against unauthorized access to your password and to your computer.\r\n</p><p>Consent\r\n</p><p>By submitting data to us or our agent or using the Site, you consent to our use of your data in the manner set out in this Privacy Policy.\r\n</p><p>Copyright\r\n</p><p>We have copyright over this Privacy Policy. Use by third parties, even by way of extract, for commercial purposes is not allowed. Infringements may be subject to legal action. This Privacy Policy can change at any time to include / exclude clauses and motorsheba.com does not bear responsibility for updating Users on the same.</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p>', 'Privacy Policy', 'Motosheba Privacy Policy', NULL, NULL, '2020-11-04 10:15:55', '2021-11-08 06:39:24'),
(7, 'custom_page', 'How to Order', 'how-to-order', '<ul class=\"nav nav-tabs\" id=\"myTab\" role=\"tablist\">\r\n  <li class=\"nav-item\" role=\"presentation\">\r\n    <a class=\"nav-link fw-600 h6 active\" id=\"add-to-cart-tab\" data-toggle=\"tab\" href=\"#place_order\" role=\"tab\" aria-controls=\"place_order\" aria-selected=\"true\">Place Order</a>\r\n  </li>\r\n  <li class=\"nav-item\" role=\"presentation\">\r\n    <a class=\"nav-link fw-600 h6\" id=\"checkout-tab\" data-toggle=\"tab\" href=\"#checkout\" role=\"tab\" aria-controls=\"checkout\" aria-selected=\"false\">Checkout</a>\r\n  </li>\r\n  <li class=\"nav-item\" role=\"presentation\">\r\n    <a class=\"nav-link fw-600 h6\" id=\"delivery-tab\" data-toggle=\"tab\" href=\"#delivery\" role=\"tab\" aria-controls=\"delivery\" aria-selected=\"false\">Delivery</a>\r\n  </li>\r\n</ul>\r\n<div class=\"tab-content\" id=\"myTabContent\">\r\n    <div class=\"tab-pane fade text-center active show\" id=\"place_order\" role=\"tabpanel\" aria-labelledby=\"place-order-tab\">\r\n        <img src=\"https://motorsheba.com/public/uploads/all/dGmPgWfhQYEFYa9eTBOhmgUCSM1VHLEaEjKRkDTJ.jpg\" class=\"img-fluid lazyloaded\" alt=\"Place Order\">\r\n    </div>\r\n    <div class=\"tab-pane fade text-center\" id=\"checkout\" role=\"tabpanel\" aria-labelledby=\"checkout-tab\">\r\n        <img src=\"https://motorsheba.com/public/uploads/all/jFR6ouOglRFGl9kTeK9zrfRFA2MbdGizbrtPEGhm.jpg\" class=\"img-fluid lazyloaded\" alt=\"Checkout\">\r\n    </div>\r\n    <div class=\"tab-pane fade text-center\" id=\"delivery\" role=\"tabpanel\" aria-labelledby=\"delivery-tab\">\r\n        <img src=\"https://motorsheba.com/public/uploads/all/hXR6erw7rnxmS1Mv6A2dqDsMQCVK2qykv61tQ7v0.jpg\" class=\"img-fluid ls-is-cached lazyloaded\" alt=\"Delivery\">\r\n    </div>\r\n</div>', NULL, NULL, NULL, NULL, '2021-10-31 04:38:10', '2021-11-10 07:16:36'),
(8, 'custom_page', 'Contact Us', 'contact-us', '<div class=\"container\">\r\n    <div class=\"contact__wrapper mt-n9\">\r\n        <div class=\"row no-gutters\">\r\n            <div class=\"col-lg-5 contact-info__wrapper p-5 order-lg-2\">\r\n                <h3 class=\"color--white mb-5\">Get in Touch</h3>\r\n    \r\n                <ul class=\"contact-info_list list-unstyled position-relative z-index-101\">\r\n                    <li class=\"mb-4 \">\r\n                         <a href=\"mailto:support@motorsheba.com\"><span class=\"mr-2\"><i class=\"las la-envelope\"></i></span>support@motorsheba.com</a>\r\n                    </li>\r\n                    <li class=\"mb-4 \">\r\n                         <a href=\"tel:+8809610500500\"><span class=\"mr-2\"><i class=\"las la-headset\"></i></span>(+880) 9610-500500</a>\r\n                    </li>\r\n                    <li class=\"mb-4 \">\r\n                        <a href=\"\">\r\n                         <span class=\"mr-2\"><i class=\"las la-map-marker\"></i></span> \r\n                          House 37, Road 27, Block A, \r\n                         <br> Banani,\r\n                         <br> Dhaka-1213.\r\n                        </a>\r\n                    </li>\r\n                    <li class=\"mb-4 \">\r\n                         <a href=\"https://www.google.com/maps/place/%E0%A6%AE%E0%A6%BE%E0%A6%87+%E0%A6%86%E0%A6%89%E0%A6%9F%E0%A6%B8%E0%A7%8B%E0%A6%B0%E0%A7%8D%E0%A6%B8%E0%A6%BF%E0%A6%82+%E0%A6%B2%E0%A6%BF%E0%A6%AE%E0%A6%BF%E0%A6%9F%E0%A7%87%E0%A6%A1/@23.7988068,90.403002,15z/data=!4m5!3m4!1s0x0:0xee65074558935d3d!8m2!3d23.7988313!4d90.4030064\" target=\"_blank\" class=\"text-link link--right-icon text-primary\"><span class=\"mr-2\"><i class=\"las la-route\"></i></span> Get directions </a>\r\n                    </li>\r\n                </ul>\r\n \r\n            </div>\r\n    \r\n            <div class=\"col-lg-7 contact-form__wrapper p-5 order-lg-1\">\r\n                 \r\n                    <div class=\"row\">\r\n                        <div class=\"col-sm-6 mb-3\">\r\n                            <div class=\"form-group\">\r\n                                <label class=\"required-field\" for=\"name\">Name</label>\r\n                                <input type=\"text\" class=\"form-control\" id=\"name\" name=\"name\">\r\n                            </div>\r\n                        </div>\r\n    \r\n                        <div class=\"col-sm-6 mb-3\">\r\n                            <div class=\"form-group\">\r\n                                <label class=\"required-field\" for=\"email\">Email</label>\r\n                                <input type=\"text\" class=\"form-control\" id=\"email\" name=\"email\">\r\n                            </div>\r\n                        </div>\r\n    \r\n                        <div class=\"col-sm-6 mb-3\">\r\n                            <div class=\"form-group\">\r\n                                <label for=\"phone_number\">Phone Number</label>\r\n                                <input type=\"tel\" class=\"form-control\" id=\"phone_number\" name=\"phone_number\">\r\n                            </div>\r\n                        </div>\r\n\r\n                        <div class=\"col-sm-6 mb-3\">\r\n                            <div class=\"form-group\">\r\n                                <label for=\"subject\">Subject</label>\r\n                                <select class=\"select2 form-control aiz-selectpicker\" name=\"subject\" data-toggle=\"select2\" data-placeholder=\"Choose ...\" data-live-search=\"true\">\r\n                                    <option value=\"Login_Registration\">Login/Registration</option>\r\n                                    <option value=\"Order\">Order</option>\r\n                                    <option value=\"Others\">Others</option>\r\n                                </select>\r\n                            </div>\r\n                        </div>\r\n    \r\n                        <div class=\"col-sm-12 mb-3\">\r\n                            <div class=\"form-group\">\r\n                                <label class=\"required-field\" for=\"message\">How can we help?</label>\r\n                                <textarea class=\"form-control\" id=\"message\" name=\"message\" rows=\"4\" placeholder=\"Hi there, I would like to.....\"></textarea> \r\n                            </div>\r\n                        </div>\r\n                        <div class=\"col-sm-12 mb-3\">\r\n                            <button type=\"submit\" name=\"submit\" class=\"btn btn-primary\">Send <span><i class=\"las la-paper-plane\"></i></span></button>\r\n                        </div>\r\n</div></div></div></div></div>', NULL, NULL, NULL, NULL, '2021-10-31 06:10:42', '2021-10-31 07:14:23'),
(9, 'custom_page', 'About Us', 'about-us', '<p>Motor Sheba Limited is a Joint Venture initiative formed for the purpose of providing an e-commerce service for automotive accessories &amp; vehicle servicing solutions.</p><p>Trade License Number: 188637</p><p>TIN Certificate Number: 7237713252769</p><p>\r\n</p><p></p><h5>Why Motorsheba</h5>\r\n<p></p><p>We started Motorsheba because Consumers are not getting their desired products as they see online and they don’t get what they are about to. That’s why Motorsheba comes into play, we make sure the premium quality products from the most popular brands or providers.\r\n</p><p>What actually differentiates us is we bring favorite products directly from suppliers, and deliver them to the doorstep of our customers. No mess, no more disappointments getting the right products. We prioritize your choice and bring the best products in a more secure way.\r\n</p><p></p><h5>Mission</h5>\r\n<p></p><p>Along the way, Motorsheba has come into the market with a great mission that determines delivering the right products to the right customers at the right time. No matter where you are, we are ready to reach your doorstep with your desired products anytime, anywhere.\r\n</p><p></p><h5>Wins</h5>\r\n<p></p><p>The company was build recently but in a short period of time, it’s improved fast and got huge responses from most of the customers. Also, we have the latest technologies to make your purchase easy and comfortable.\r\n</p><p></p><h5>The Ultimate Goal</h5>\r\n<p></p><p>In addition to that, our goal is to make the online platform as secure, reliable, and easy to deal with, so people can be able to choose their desired products and get better experiences.&nbsp;</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p>', 'About Us', 'Motorsheba About Us', NULL, NULL, '2021-10-31 08:51:19', '2021-11-01 05:38:07');
