(1, 'AN-764K, Brake Pad, AKEBONO', 'seller', 23, 10, 3, '246', '246', 'youtube', NULL, 'parts,brake pad', 'AKEBONO Brake pad & shoes from Japan with their 100 years experience.', 'The three basic dynamic elements of an automobile are “go, stop, and turn.” Among these, the most important one related to safety is \"stop.\" The \"brake\" bears this function of \"stop.\" The brake “decelerates and stops” an automobile in motion. Furthermore, brakes also keep a parked automobile from moving (parking brake).\nThe \"brake\" is one of the most important safety-related components of an automobile, and is indispensable for realizing safety and security.\nAkebono has been developing and manufacturing brake products for automobiles since the company was founded in 1929. Sales of automotive products, including motorcycles, account for more than 95% of total sales. Main products are disc brakes and drum brakes, and the corresponding friction material, which are the brake pads and brake linings, respectively.\n\nChoice your \"SAFETY\" from AKEBONO !!!', 5100.00, NULL, 0, '[]', '[]', '22,23,24,25', '1', '213,285', '[]', '[]', 0, 1, 'quantity', 1, 0, 0, 0, NULL, 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'flat_rate', NULL, 0, NULL, 0, NULL, NULL, NULL, NULL, 'AN-764K-Brake-Pad-AKEBONO-yz0nZ', 0.00, NULL, 0, NULL, NULL, '2021-11-08 10:36:20', '2021-11-08 10:36:20'),
