INSERT INTO `product_translations` (`id`, `product_id`, `name`, `unit`, `description`, `lang`, `created_at`, `updated_at`) VALUES
(2, 512, 'AN-716WK, Brake Pad Rear, Akebono', NULL, 'The three basic dynamic elements of an automobile are “go, stop, and turn.” Among these, the most important one related to safety is \"stop.\" The \"brake\" bears this function of \"stop.\" The brake “decelerates and stops” an automobile in motion. Furthermore, brakes also keep a parked automobile from moving (parking brake).\r\nThe \"brake\" is one of the most important safety-related components of an automobile, and is indispensable for realizing safety and security.\r\nAkebono has been developing and manufacturing brake products for automobiles since the company was founded in 1929. Sales of automotive products, including motorcycles, account for more than 95% of total sales. Main products are disc brakes and drum brakes, and the corresponding friction material, which are the brake pads and brake linings, respectively.\r\n\r\nChoice your \"SAFETY\" from AKEBONO !!!', 'en', '2021-11-11 05:44:47', '2021-11-11 05:44:47');
